    return (
        <div>
            <ul className="main-nav">
                <Link style={textDecoration="none"} to='/'>
                <li id="home">Home</li>
                </Link>
                <Link to='/mybalance'>
                <li>My Wallet</li>
                </Link>
                <li>Convert</li>
            </ul>
        </div>
    )

}

export default Nav;
